import React from "react";

const Groceries = (groceries) => {
  const groce = groceries.map((row, index) => {
    return (
      <tr key={index}>
        <td>{index}</td>
        <td>{row.name}</td>
        <td>{row.age}</td>
        {/* <td>
          <button onClick={() => props.removeItem(index)}>Delete</button>
        </td> */}
      </tr>
    );
  });
};

export default Groceries;
